// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Burnable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/access/Ownable.sol";


contract Ico is ERC721Burnable,Ownable{

    using Counters for Counters.Counter;

    ///////////////-----Variable-------------///////////
    Counters.Counter private _tokenIds;
    address[] acceptedCoins;

    uint256 internal PRICE=10**10 wei;
    mapping(address=>uint256) private COINS_PRICE;

    uint256 internal HARD_CAP=20000;
    uint256 internal SUPPLY=5000;

    /**@dev How much native token for 1 $VRK */
    uint256 internal RATE=10**14 wei;


    constructor() ERC721("ICO Token", "ICO") {

    }

    struct Entry {
        uint256 tokenId;
        uint256 supply;
    }

    mapping(uint256=>Entry) LISTA;


    modifier checkCap(){
        require(getTotal()<HARD_CAP,'Hard Cap achieved');
        _;
    }

    //Only the owner can call this function to mint the NFT.
    function ManualMinting(
        uint256 supply,
        address receiver
        ) external onlyOwner checkCap returns(uint256){

        //Increment the counter
        _tokenIds.increment();

        uint256 newItemId = _tokenIds.current();
        _mint(receiver, newItemId);


        Entry memory newCerti= Entry(
        _tokenIds.current(),//token id of initial coin offering NFT
        supply
        );

        LISTA[newItemId] = newCerti;

        return newItemId;

    }

    function checkPrice(uint256 quantity)external view returns(uint256){
        return RATE*quantity;
    }

    /**
    @dev Any user can call this function and mint their own supply tickets 
     */
    function publicMinting(uint256 quantity) 
    external payable checkCap returns (uint256){

        uint256 finalPrice=quantity*RATE;
        require(msg.value>=finalPrice,'Need to reach the price per token');

        _tokenIds.increment();

        uint256 newItemId = _tokenIds.current();
        _mint(msg.sender, newItemId);

        Entry memory newCerti= Entry(
        newItemId,//token id of the ico exchange
        quantity
        );

        LISTA[newItemId] = newCerti;

        return newItemId;

    }
    /**
    @dev
    This function set the price in native token.
     */
    function setPrice(uint256 _newPrice)external onlyOwner{
        PRICE=_newPrice;
    }

    function setSupply(uint256 _howMuch)public onlyOwner{
        SUPPLY=_howMuch;
    }

    function setRate(uint256 _howMuch)public onlyOwner{
        RATE=_howMuch;
    }

    function getRate()external view returns(uint256){
        return RATE;
    }


////////////////////////---ERC-20 Functions--------/////////////////////////////////////////////////////////////
    modifier LegalCoin(address _coin){
        bool pass=false;
        for (uint256 index = 0; index < acceptedCoins.length; index++) {
            if(acceptedCoins[index]==_coin){
                pass=true;
                break;
            }
        }
        require(pass,'not accepted coin');
        _;
    }


    function addCoin(address coinAddress,uint256 price)external onlyOwner{
        acceptedCoins.push(coinAddress);
        COINS_PRICE[coinAddress]=price;
    }    

    function setPriceERC20(address coin,uint256 _newPrice)external onlyOwner{
        require(_newPrice>0,'price has to be more than 0');
        for (uint256 index = 0; index < acceptedCoins.length; index++) {

            if(acceptedCoins[index]==coin){
                COINS_PRICE[coin]=_newPrice;
                break;
            }
        }

    }

    function PublicMintingERC20(address _token_address) 
        external LegalCoin(_token_address) checkCap  returns (uint256){

        uint256 _price=COINS_PRICE[_token_address];
        require(_price>0);
        bool successful=IERC20(_token_address).transferFrom(msg.sender, address(this), _price);
        require(successful,'ERC20 transfer didnt work');
        _tokenIds.increment();

        uint256 newItemId = _tokenIds.current();
        _mint(msg.sender, newItemId);

        Entry memory newCerti= Entry(
        newItemId,//token id of the ico exchange
        SUPPLY
        );

        LISTA[newItemId] = newCerti;

        return newItemId;

    }


    function get(uint256 _index)public view returns(Entry memory){
          return LISTA[_index];
    }

    /**
    @dev
    This function is called by the Vrakka Smart contract to ask how many tokens
    will mint.
     */
    function checkSupply(uint256 tokenId)external view returns(uint256){
        uint256 ticketSupply=LISTA[tokenId].supply;
        return ticketSupply;
    }


    function getTotal()public view returns(uint256){
        return(_tokenIds.current());
    }

    function burn(uint256 tokenId)public override{
      address _owner=ownerOf(tokenId);
      require(_owner==tx.origin,'only owner can burn share');
      _burn(tokenId);
    }    

}

